jQuery(function() {
    initSlick();
    initTimeTo();
    initjQueryUI();
    initCustomScrollbar();
    initListJS();
    initCustomForms();
});

// init List.js
function initListJS() {
    var options = {
        valueNames: [ 'label-checkbox' ]
    };

    var filterList = new List('filter', options);
}

// init custom scrollbar plugin
function initCustomScrollbar() {
    $('.custom-scroll').mCustomScrollbar({});
}

// init all plugins from jQueryUI
function initjQueryUI() {
    var availableCategories = [
        "category_01",
        "category_02",
        "category_03",
        "category_04",
        "category_05",
        "category_06",
        "category_07",
        "category_08",
        "category_09",
        "category_10",
        "category_11",
        "category_12",
        "category_13",
        "category_14",
        "category_15",
        "category_16",
        "category_17",
        "category_18",
        "category_19",
        "category_20",
        "category_21",
        "category_22",
        "category_23",
        "category_24",
        "category_25",
        "category_26",
        "category_27"
    ];

    $( "#categories").autocomplete({
      source: availableCategories
    });

    $( ".open-close").each(function(){
        var $this = jQuery(this),
            opener = $this.find('.opener'),
            activeClass = "active";

        opener.on('click', function(e){
            e.preventDefault();

            opener.parent().toggleClass(activeClass);
        });
    });

    $( "#slider-range" ).slider({
        range: true,
        min: 120,
        max: 8980,
        values: [ 120, 8980 ],
        slide: function( event, ui ) {
            $("#start").val($("#slider-range").slider("values", 0));
            $("#end").val($("#slider-range").slider("values", 1));
        }
    });
    
    $("#start").val($("#slider-range").slider("values", 0));
    $("#end").val($("#slider-range").slider("values", 1));
}

// initialize custom form elements
function initCustomForms() {
    jcf.replaceAll();
}

// countdown plugin initTimeTo();
function initTimeTo() {
    var $this = jQuery()

    $('.countdown').each(function(){
        var $this = jQuery(this);
        
        $this.timeTo({
            timeTo: new Date(new Date('Sun May 26 2020 09:00:00 GMT+0300 (Восточная Европа, летнее время)')),
            displayDays: 2,
            displayCaptions: true,
            fontSize: 18,
            captionSize: 8
        });
    });
}

// slick initialization
function initSlick() {
    $('.slick-slider').slick({
        slidesToShow: 5,
        slidesToScroll: 1,
        infinite: false,
        dots: true,
        // adaptiveHeight: true,
        arrows: false
    });
    $('.slick-logos').slick({
        slidesToShow: 8,
        slidesToScroll: 1,
        infinite: false,
        arrows: false
    });
    $('.product-slider .slider-for').slick({
        slidesToShow: 1,
        slidesToScroll: 1,
        arrows: false,
        fade: true,
        asNavFor: '.slider-nav'
    });
    $('.product-slider .slider-nav').slick({
        slidesToShow: 3,
        slidesToScroll: 1,
        asNavFor: '.slider-for',
        dots: true,
        // centerMode: true,
        focusOnSelect: true,
        variableWidth: true
    });
    $('.slick-images').slick({
        arrows: false,
        dots:true,
        infinite: false
    });
}

